import React, { Component } from "react";
import {Link} from "react-router-dom";
import "./accueil.css";
import Data from "./data.json"

function Article (props) {

    const appartements = Data
    const listAppartements = appartements.map((appartement) =>
        <li key={appartement.toString()}>
            {appartement}
        </li>
    )

    return (
        <Link to={appartements[0].id}>
            <div id="article">
                <ul>
                    {listAppartements}
                </ul>
                <p id="article__title">{appartements[0].title}</p>
            </div>
        </Link>
    )
}

export default class Accueil extends Component{

    render() {
        return (
        <div id="articles">
            <Article />
        </div>
        )
    }
}
